{
  "name": "UBX-NAV-AOPSTATUS",
  "class_id": "0x01",
  "message_id": "0x60",
  "description": "This message provides information on the status of the AssistNow Autonomous subsystem on the receiver. For example, a host application can determine the optimal time to shut down the receiver by monitoring the status field for a steady 0. See the integration manual for details on this feature.",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 16
    },
    "fields": [
      {
        "name": "iTOW",
        "byte_offset": 0,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch. See the description of iTOW for details.",
        "unit": "ms"
      },
      {
        "name": "aopCfg",
        "byte_offset": 4,
        "data_type": "X1",
        "description": "AssistNow Autonomous configuration",
        "bitfield": {
          "bits": [
            {
              "name": "useAOP",
              "bit_start": 0,
              "bit_end": 0,
              "description": "AOP enabled flag"
            }
          ]
        }
      },
      {
        "name": "status",
        "byte_offset": 5,
        "data_type": "X1",
        "description": "AssistNow Autonomous subsystem is idle (0) or running (not 0)"
      },
      {
        "name": "reserved0",
        "byte_offset": 6,
        "data_type": {
          "array_of": "U1",
          "count": 10
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}

